  return (
    <header>
      <div className="header-wrapper">
        <div className="site-title">Dress</div>
        <div className="header-right">
          <ul>
            <li>Cart</li>
            <li>Favorites</li>
            <li>Profile</li>
          </ul>
        </div>
      </div>
    </header>
  );
};
